(70, 2, 'admin', 'Pelatihan Peningkatan Kapasitas Kelompok Perempuan', 'pelatihan-peningkatan-kapasitas-kelompok-perempuan', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Kelompok perempuan Pekon Way Batang Kecamatan Way Batang diberikan pelatihan pertanian, di balai pekon setempat, Selasa (24/4) kemarin. Tujuannya adalah agar kelompok perempuan dapat maju dan berkembang dalam kemandirian bertani, sehingga dapat menghasilkan nilai pertanian yang produktif dari pemanfaatan pekarangan rumah. Pj. Kepala Pekon Way Batang Mat Hapipi mengatakan pelatihan kapasitas yang diselenggarakan oleh pemerintah pekon dikhususkan bagi kelompok perempuan yang ada diPekon Way Batang.&quot;Kegiatan ini merupakan bentuk program pemerintah Pekon Way Batang yang menggunakan dana Pekon untuk pelaksanaan bidang pemberdayaan bagi masyarakat,&quot; pungkasnya. Dia melanjutkan, kegiatan pemberdayaan masyarakat dilaksanakan sebagai bentuk realisasi usulan masyarakat dalam tahapan musDes tahun 2017 yang kita wujudkan dalam perencanaan APBdes 2018. &quot;Tujuan kegiatan ini sebagai bentuk penambahan wawasan dan pengetahuan para anggota dan kelompok tani Pekon Way Batang ,&quot; pungkasnya. Sementara itu, ketua pelaksana kegiatan Widodo mengatakan pelaksanaan kegiatan pelatihan peningkatan kapasitas bagi kelompok wanita tani Pekon Way Batang merupakan program dari realisai dana Pekon bidang pemberdayaan tahun 2018. &quot;Kami mengucapkan terimakasih kepada para kelompok perempuan yang telah hadir dalam mengikuti kegiatan pelatihan kapasitas bagi kelompok perempuan yang dilaksanakan pada hari ini. Diharapkan kapasitas kelompok perempuan di Pekon Way Batang dapat meningkat,&quot; katanya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-13', '07:06:34', '4IMG_20180426_090728.jpg', 12, ''),
(53, 8, 'admin', 'Budidaya Ikan Lele di Pekon Way Batang', 'budidaya-ikan-lele-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat-Sektor perikanan merupakan sektor unggulan Pekon Way Batang Kecamatan Way Batang, selain sektor Pertanian dan Pembuatan Batu Bata. saat ini tercatat hampir 45 persen masyarakat pekon setempat berprofesi sebagai peternak ikan.</p>\r\n\r\n<p>ketua gabungan kelompok peternak ikan(POKDA) Pekon Way Batang Feri Nurdiyanto, menyatakan,di wilayahnya terdapat 3 kelompok peternak</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-18', '07:18:30', '30IMG_20180429_070822.jpg', 1, ''),
(54, 2, 'admin', 'Pelatihan Peningkatan Kapasitas Kelompok UP2K', 'pelatihan-peningkatan-kapasitas-kelompok-up2k', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>PKK Pesisir Barat - Pemerintah Pekon Way Batang Kecamatan Way Batang menyelenggarakan pelatihan peningkatan kapasitas kelompok perempuan (PKK). Pelatihan diikuti oleh 60 orang di balai pekon setempat. Dalam kesempatan tersebut, Pj Kakon Kediri Mat Hapipi mengatakan kader PKK sebagai organisasi pemberdayaan perempuan dan pembinaan keluarga memiliki peran yang sangat penting dan strategis dalam pembangunan Pekon Way Batang. Menurutnya, hal tersebut seperti diamanatkan dalam Permendagri Nomor 1 Tahun 2013 tentang Pemberdayaan Masyarakat melalui Gerakan Pemberdayaan dan Kesejahteraan Keluarga. &quot;Diharapkan PKK senantiasa berupaya mewujudkan cita-cita organisasi, yaitu terbinanya keluarga yang beriman dan bertaqwa kepada Tuhan Yang Maha Esa,&quot; pungkasnya. Dirinya berharap, kegiatan ini tidak hanya sebatas kegiatan seremonial saja, tetapi semakin memperkuat dan memantapkan fungsi kelembagaan PKK. Sehingga diharapkan para kader PKK mampu berperan secara optimal menuju kesejahteraan keluarga. &quot;Saya mengimbau, agar para pengurus Tim Penggerak PKK di Pekon Way Batang serta para kader untuk semakin meningkatkan kinerja organisasi dan memantapkan kelembagaan, sehingga dapat lebih berperan secara optimal dalam upaya memberdayakan keluarga menuju kesejahteraan keluarga,&quot; pungkasnya. Dia mengatakan kegiatan pembinaan kader PKK bertujuan untuk meningkatkan pengetahuan dan pemahaman kader mengenai program - program yang digalakkan tim PKK. &quot;Seperti program kesehatan,kelestarian lingkungan hidup, dan perencanaan sehat. Peserta pelatihan yakni dari kader PKK Pekon Way Batang,&quot; pungkasnya. Dalam kesempatan tersebut Wakil Sekretaris Tim PKK Kabupaten Pesisir Barat Erna Syamsir menyampaikan 10 program pokok PKK. Seperti, penghayatan dan pengamalan Pancasila, gotong royong, pangan, sandang, perumahan dan tata laksana rumah tangga, pendidikan dan ketrampilan, kesehatan mengembangkan kehidupan berkooperasi, pelestarian lingkungan hidup serta perencanaan hidup sehat. (Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-01', '12:33:40', '52IMG_20180501_094143.jpg', 1, ''),
(40, 2, 'admin', 'Angin Kencang Rubuhkan Rumah Warga Pekon Way Batang', 'angin-kencang-rubuhkan-rumah-warga-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Akibat hujan disertai angin kencang yang turun di kecamatan Way Batang, rumah milik Wahyu Eko Prananda (21) warga RT 01, RW 01 Pekon Way Batang ambruk sekitar pukul 16.00 WIB pada hari Minggu (11/2/2018).</p>\r\n\r\n<p>Beruntung tidak ada korban jiwa dalam perisitiwa rumah yang roboh berbahan geribik berukuran 6 x 9 meter persegi. Namun kerugian perabotan rumah tangga yang hancur rusak tertimpa atap bangunan ditaksir mencapai sekitar Rp 20 jutaan.</p>\r\n\r\n<p>Petugas satgas pada Badan Penanggulangan Bencana Daerah (BPBD) kabupaten Pesisir Barat, Tabrani mewakili kepala BPBD Pesisir Barat, M. Khotim mengatakan rumah yang roboh diduga sudah mulai rapuh karena diterjang angin angin kencang disertai hujan.</p>\r\n\r\n<p>&quot;Kerugian rumah ambruk yang berisi perabotan rumah tangga meliputi lemari pakaian, kursi tamu plastik,peralatan dapur,tempat tidur, speaker aktif dan TV 21 inci berkisar Rp 20 jutaan. Untuk korban jiwa tidak ada nihil dalam kejadian ini,&quot; singkatnya.</p>\r\n\r\n<p>Menurut Tabrani, bahwa kronologis saat kejadian rumah roboh itu tidak ada orang dalam keadaan kosong ditinggal pergi ke rumah orang tuanya. &quot;Istri korban sebelum hujan baru keluar rumah ke tempat orang tua dan suaminya sedang berkerja di Lampung Timur. Jadi, rumah dalam keadaan kosong ditinggal ke tempat orang tuanya. Kemudian barulah hujan turun disertai angin yang kencang hingga merobohkan bangunan rumah non permanen itu,&quot; tandasnya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Senin', '2018-05-13', '06:59:38', '65received_1665823396796581.jpeg', 1, ''),
(50, 5, 'admin', 'Produksi Batu Bata Pekon Way Batang', 'produksi-batu-bata-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Saat ini selain sektor pertanian, perkebunan dan kerajinan ternyata banyak masyarakat Kabupaten Pesisir Barat yang menggantungkan hidupnya dari sektor pembuatan batu bata merah. Hal ini bisa dilihat di Pekon Way Batang Kecamatan Way Batang.</p>\r\n\r\n<p>Salah seorang pengrajin, Darimun mengaku sudah memulai usaha sebagai pengrajin batu bata sudah 33 tahun. Dalam sebulan dirinya mampu memproduksi 30.000 buah bata. Mengenai pemasaran dirinya mengaku tidak bingung karena ada pihak pengepul.</p>\r\n\r\n<p>Darimun menjelaskan batu bata digunakan untuk membuat dinding rumah. Dinding yang menggunakan bahan batu bata memiliki daya serap terhadap panas cukup baik sehingga terasa nyaman. Harganya yang relatif murah dan banyak tersedia menjadi pilihan terbaik sampai saat ini untuk bangunan rumah tinggal.</p>\r\n\r\n<p>&quot;Yang tidak kalah penting dalam menjaga mutu dari dinding adalah spesi atau perekat antar bata. Campuran yang baik akan menyebabkan dinding awet dan bisa bertahan terhadap resapan air dari tanah maupun air hujan. Semakin baik kualitas spesi yang digunakan untuk merekatkan bata, semakin berkualitas pula dinding yang didapat,&quot;paparnya.</p>\r\n\r\n<p>Dalam memproduksi 30.000 buah bata bapak 4 anak ini hanya dibantu oleh istrinya. Untuk memproduksi batu bata sebanyak itu dirinya membutuhkan tanah sebanyak 5 truck dengan harga per truck Rp. 330.000, kayu bakar sebanyak 9 kubik dengan harga per kubik Rp. 125.000 dan merang (kulit padi) sebanyak 120 karung dengan harga per karung Rp.5.000.</p>\r\n\r\n<p>Warga RT/RW 02/03 ini menjelaskan saat di RT terdapat 8 orang yang berprofesi seperti dirinya membuat batu-bata. Ia mengaku dirinya merupakan perintis usaha batu bata di lingkungan setempat.&quot;Saya adalah salah seseorang yang merintis usaha pembuatan batu bata disini sejak tahun 1984. Baru kemudian warga lainnya mengikuti,&quot;katanya. Pada awal merintis usaha batu bata saat itu harganya Rp. 75 per biji dan saat ini harga batu bata ber</p>\r\n\r\n<p>Pada awal merintis usaha batu bata saat itu harganya Rp. 75 per biji dan saat ini harga batu bata berkisar Rp. 260 - 270 batang. Menurut dia, kendala yang kerap dihadapi para pengrajin batu bata adalah cuaca yang tidak menentu dan terkendala modal. &quot;Saat memasuki musim penghujan seperti sekarang ini, kami sering menghadapi kendala misalnya baru mau cetak hujan terpaksa harus ditunda. Selain itu batu batu butuh cahaya matahari untuk mengeringkan, nah dipastikan bila masuk musim penghujan seperti saat ini kadang produksi tidak menentu apalagi hujan setiap hari selalu turun,&quot;terang Pariman.</p>\r\n\r\n<p>Dirinya menjelaskan bahwa kadang bila memasuki musim penghujan karena terPekonk kebutuhan sehari-hari dan batu bata belum selesai diproduksi, dirinya dan pengrajin lainnya terpaksa berhutang dulu ke para pengepul dan dibayar ke pengepul bila batu bata laku terjual.&quot;Tapi harganya berbeda bila kami berhutang dulu ke pengepul dan kami jual langsung ke konsumen. Selisih harganya adalah Rp. 10 per biji lebih murah jika kami berhutang dulu ke pengepul, &quot;jelasnya.</p>\r\n\r\n<p>Pariman mengaku selama 33 tahun melakoni usaha sebagai pengrajin batu bata hanya sekali mendapatkan bantuan permodalan dari pemerintah. Menurut dia bantuan tersebut sebesar Rp. 500.000 itupun sekitar tahun 2001-2002. Kedepan dirinya berharap ada perhatian khusus dari pemerintah terhadap para pengrajin batu bata di Pekon Way Batang, Kecamatan Way Batang. Mengingat pengrajin batu bata merupakan salah satu sumber pendapatan sebagian masyarakat Pekon Way Batang.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Senin', '2018-03-26', '12:26:02', '86IMG_20180317_091841.jpg', 2, 'ekonomi'),
(72, 5, 'admin', 'Sektor UKM Indonesia Terus Diminati banyak Masyarakat', 'sektor-ukm-indonesia-terus-diminati-banyak-masyarakat', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>(Berita Daerah &ndash; Nasional) Masyarakat Ekonomi ASEAN yang akan berjalan pada tahun 2021 mendatang memang akan menjadi sebuah peluang sekaligus menjadi tantangan bagi ekonomi Indonesia. Dengan berlakunya MEA 2021 maka negara-negara di ASEAN akan mengalami aliran bebas terhadap barang dan jasa, investasi serta tenaga kerja terdidik dari dan ke masing-masing negara.</p>\r\n\r\n<p>Masyarakat Ekonomi ASEAN ini akan terjadi integrasi terhadap masing-masing negara melalui penghilangan tarif pajak perdagangan antar negara ASEAN yang tentunya akan sangat berpengaruh terhadap pembangungan dan pertumbuhan ekonomi tiap negara di ASEAN. Indonesia harus bersiap untuk menghadapi MEA tersebut yaitu dengan memperkuat industri-industri stategis dan andalan agar mampu meningkatkan kualitas sehingga dapat bersaing dengan industri asing.</p>\r\n\r\n<p>Selain itu sektor usaha koperasi dan UKM juga perlu diperhatikan karena mampu menjadi penggerak ekonomi rakyat dan juga mampu menyerap banyak tenaga kerja muda di Indonesia. Kementerian Koperasi dan UKM juga telah menyiapkan langkah-langkah strategis untuk membantu pelaku KUKM dalam menghadapi MEA dengan melakukan peningkatan wawasan pelaku KUKM, peningkatan efisiensi produksi dan manajemen usaha, peningkatan daya serap pasar produk KUKM lokal serta dalam menciptakan iklim usaha yang kondusif.</p>\r\n\r\n<p>Penggunaan teknologi informasi dan komunikasi bagi pelaku KUKM juga terus digenjot oleh pemerintah karena itu dangat diperlukan para pelaku KUKM di Indonesia ditengah persaingan usaha yang semakin ketat pada era globalisasi seperti sekarang ini dan khususnya untuk menghadapi MEA pada tahun 2021 mendatang.</p>\r\n\r\n<p>Pemanfaatan penggunaan teknologi informasi dan komunikasi dalam kegiatan usaha mikro, kecil, dan menengah dalam negeri harus melalui kerja sama pemerintah dengan pihak swasta sehingga daya saing UKM Indonesia pun akan semakin meningkat.</p>\r\n\r\n<p>Sektor sumber daya manusia juga menjadi perhatian utama karena selama ini sektor itu disebut menjadi kendala utama karena masih rendahnya kualitas SDM pelaku KUKM di Indonesia.</p>\r\n\r\n<p>Oleh karena itu Kementerian Koperasi dan UKM gencar melakukan berbagai pembinaan dan pelatihan untuk meningkatkan kualitas pelaku KUKM yang bersifat manajerial maupun bersifat teknis. Karena dengan semakin banyaknya sember daya menusia yang terampil akan berdampak pula terhadap kualitas produk yang dihasilkan.</p>\r\n\r\n<p>Sektor Koperasi dan UKM yang paling peting untuk dikembangkan dalam menghadapi MEA 2015 mendatang adalah yang terkait dengan industri kreatif dan inovatif, handicraft, home industry dan teknologi informasi.</p>\r\n\r\n<p>UKM di bidang industri akan semakin memiliki peran yang penting bagi pembangunan ekonomi nasional karena dapat menjadi salah satu sektor yang akan menyerap banyak tenaga kerja sehingga dapat mengurangi jumlah angka kemiskinan melalui perluasan kesempatan kerja yang mampu menghasilkan barang dan jasa untuk di ekspor.</p>\r\n\r\n<p>Hasil industri UKM Indonesia memang sangat diminati oleh konsumen dalam negeri maupun luar negeri karena mampu menghasilkan produk yang unik, inovatif serta menarik. Selain itu juga produk UKM Indonesia kental dengan unsur budaya kedaerahan dan memiliki sentuhan seni khas daerah yang membuat produk UKM di Indonesia semakin diminati.</p>\r\n\r\n<p>Dalam dunia industri kreatif memang diperlukan inovasi &nbsp;terhadap produk yang dihasilkan sesuai dengan perubahan perkembangan zaman serta tampilan yang menarik sehingga dapat bersaing dengan produk dari industri asing.</p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2018-03-16', '19:02:23', '67industri-rotan-daerah-foto.tmpo-709.jpg', 15, ''),
(48, 2, 'admin', 'Pj Kakon Kediri Mat Hapipi Dilantik', 'pj-kakon-Kediri-mat-hapipi-dilantik', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Penjabat (Pj) Kepala Pekon Way Batang Mat Hapipi dilantik oleh Camat Way Batang Basroni di kantor kecamatan setempat, Senin (12/2/2018). Mat Hapipi menggantikan kepala pekon sebelumnya oleh Supriono, yang masa jabatan dan tugasnya habis pada tanggal 31 Januari 2018 lalu.</p>\r\n\r\n<p>Dalam kesempatan tersebut Basroni berharap kepada Penjabat (Pj) Kepala Pekon Way Batang Mat Hapipi yang baru dilantik ini, bisa selalu berkoordinasi dengan pihak kecamatan dalam menjalankan roda pemerintah.</p>\r\n\r\n<p>&quot;Saya harap kakon yang baru dilantik ini dapat bekerja sama dalam tugas dengan aparatur pekon, dalam meningkatkan pelayanan kepada masyarakat. Hal tersebut sesuai dengan tujuan menunjuk Pj. Kakon , agar roda pemerintahan di pekon tersebut dapat terus berjalan dalam melayani masyarakat,&quot; ucapnya.</p>\r\n\r\n<p>Ditempat yang sama, Kabag Bina Pemerintahan Pemkab Pesisir Barat Dewanto Dwi Utomo berharap kepada Pj. Kepala Pekon Way Batang, dapat memberikan pelayanan yang lebih baik lagi terhadap seluruh masyarakat pekon setempat.</p>\r\n\r\n<p>&quot;Dan selalu mengutamakan kerja sama dengan aparatur Pekon, BHP dan masyarakat Pekon Way Batang, dalam membangun Pekon ini ke arah yang lebih baik lagi,&quot; pintanya.</p>\r\n\r\n<p>Selain itu juga &lrm;Pj. Kepala Pekon Way Batang ini diharapkan dapat menjaga situasi keamanan dan kondusifitas pekon, khususnya dalam menghadapi pemilihan Gubernur dan Wakil Gubernur dan Pemilihan Kepala Pekon (Pilkakon) serentak tahun 2018.</p>\r\n\r\n<p>&ldquo;Disamping itu juga saya harap Pj. Kakon dapat mempersiapkan segala sesuatunya, untuk kelancaran dalam pelaksanaan pada pilgub dan pilkakon di pekon setempat,&rdquo; ungkapnya. Tampak hadir dalam acara tersebut, &lrm;jajaran Uspika kecamatan Way Batang meliputi Danramil Way Batang Kapten Puryanto, Kapolsek Way Batang IPTU. Edi Suhendra, ketua APDESI kecamatan Way Batang Burhan, para tokoh agama dan tokoh masyarakat Pekon Way Batang.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Rabu', '2018-03-21', '19:43:56', '27received_1665823516796569.jpeg', 22, ''),
(45, 8, 'admin', 'Peternakan Ayam Boiler', 'peternakan-ayam-boiler', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Kebutuhan masyarakat akan protein hewani terutama yang bersumber dari daging unggas sangat besar. Hal inilah yang dilihat oleh Wanto warga Pekon Way Batang Kecamatan Way Batang. Melihat potensi yang sangat luar biasa ini, Wanto mengembangkan usaha budidaya pembesaran ayam broiler di lokasi peternakan yang tidak jauh dari rumah tinggalnya. Usaha yang di rintis sejak 3 tahun yang lalu ini dimulai setelah tidak mendapatkan hasil maksimal dari usaha yang sebelumnya, yaitu beternak bebek petelur. Belajar dari kegagalan itu, pria kelahiran 1975 ini merintis usaha pembesaran ayam broiler di bekas kandang bebek yang sudah di modifikasi. Akan tetapi hanya ayam broiler berjenis kelamin jantan saja yang di budidayakan, mengingat pertumbuhan ayam broiler jantan cenderung lebih cepat daripada ayam broiler berjenis kelamin betina. Dalam satu periode masa pembesaran biasanya di butuhkan 60 hari sejak DOC (day old chick) di terima dari penyedia bibit ayam, usaha yang bersifat semi kemitraan ini tidaklah membutuhkan waktu yang banyak dalam pengurusannya/pemeliharaannya. Proses pemanenan ayam ini biasanya dilakukan sesuai dengan perjanjian di awal dengan pihak inti dari kemitraan, tentunya dengan perjanjian harga jual di saat panen juga. Hal inilah yang sedikit banyak membuat Wanto lebih yakin dengan usahanya, karena adanya kepastian harga jual dari pihak inti kemitraan. Ayam broiler yang dibesarkan khusus yang jantan. Apalagi melihat harga pasar terhadap komoditas daging dan telur yang sering mengalami fluktuatif harga, membuat para peternak harus pandai-pandai mengatur strategi agar ada keuntungan dari usaha di bidang peternakan ini. Akan tetapi dengan adanya perjanjian di awal pemeliharaan tentu para peternak tidak perlu kwatir apabila ada penurunan harga jual di bawah harga pasar jika panen nanti, karena semua sudah jelas di perjanjian sebelumnya. Tinggal para peternak seperti Wahono ini melaksanakan perawatan dan pemeliharaan ayam ternaknya agar didapatkan hasil maksimal. Tenaga kerja memberi makan harus tepat waktu. Dalam pengelolaan budidaya ternak ayam ini, Wanto di bantu oleh satu orang tenaga yang berasal dari warga sekitar tempat tinggalnya. Bisa di katakan pekerjaan yang di lakukan bisa di kerjakan sambil melakukan aktivitas yang lain. Dengan semangat wirausaha yang tinggi, budidaya pembesaran ayam ini masih menjanjikan keuntungan yang lumayan bagi peternak dengan usaha kecil seperti Wanto. Apalagi jika mampu memberdayakan warga sekitar bukan tidak mungkin, tidak hanya ayam broiler saja yang bisa di budidayakan, bahkan ayam kampung (jowo) bisa jadi peluang usaha yang cukup menjanjikan juga.(Wahyuni)<span style=\"font-size: 13.5pt;\"><o:p></o:p></span></p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2018-03-16', '15:53:00', '961228-ayam_unggas.jpg', 23, ''),
(46, 6, 'admin', 'Pengembangan Tanaman Kakao ', 'pengembangan-tanaman-kakao-', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Bagi para penikmat coklat, kakao tentu sudah tidak asing lagi. Rasanya yang selalu enak dan manis serta banyak manfaat merupakan salah satu daya tarik dari kakao/coklat. Kakao bermanfaat untuk mencegah kanker, penurun tekanan darah, anti oksidan dan sebagainya. Tanaman kakao merupakan bahan baku coklat yang dapat berbuah sepanjang tahun. Itulah sebabnya kenapa banyak petani tertarik membudidayakan tanaman kakao, salah satunya Bayu Saputra warga Pekon Way Batang. Kakao (Theobroma cacao L.) merupakan tanaman tahunan. Jika dibudidayakan dengan baik dapat memberikan produksi yang menguntungkan sampai umur yang panjang hingga puluhan tahun. Berdasarkan pengamatan Bayu Saputra yang akrab disapa Bayu, produksi puncak kakao di kebun kakao di Pesisir Barat dapat dicapai pada umur 10-20 tahun. Melihat banyaknya petani kakao yang mendapat penghasilan besar, semenjak lulus SMU, Bayu pun memulai menjalankan budidaya kakao atas dasar hobi di bidang agribisnis. Dimulai tahun 2002 dengan modal Rp 500.000, ia pun mulai membeli berbagai peralatan, pupuk dan obat-obatan. Sementara untuk lahan, ia mengandalakan lahan perkebunan baru seluas 1 Ha milik orang tuanya. Kakao yang dijual Bayu berupa biji kakao yang sudah difermentasi/dikeringkan dan sudah siap menjadi bahan baku coklat. Dari proses fermentasi, terjadi penyusutan dari buah kakao segar menjadi biji kakao terfermentasi sebesar 50%. Produksi buah kakao saat ini bisa mencapai sekitar 800 kg - 1 ton dari 1 Ha lahan, yang ditanami sekitar 600-700 pohon kakao. Satu pohon pada saat musim hujan mampu menghasilkan sekitar 4-5 kg buah kakao. Untuk urusan penjualan, Bayu kini telah memiliki agen atau tengkulak yang bersedia membeli hasil panen Ahmad tiap harinya dengan harga mencapai Rp 13.000/kg. Harga tersebut pun dapat berubah-ubah setiap harinya sesuai permintaan ekspor dan impor komoditi kakao. Atas kerja kerasnya selama ini, Bayu pun sudah dapat merasakan keuntungan yang tidak sedikit semejak menjalankan usaha budidaya kakao. Dalam sebulan saja, Ia telah mampu meraup omset hingga Rp 24.000.000 per bulan dengan keuntungan bersih hingga 68% atau sekitar Rp 16.500.000. Mengenai persaingan, Bayu merasa persaingan dalam usaha ini tidak begitu ketat, asal punya modal dan bisa menanam dalam jumlah banyak akan menghasilkan untung tinggi. Karena berapapun stok yang ada pada petani akan dibeli oleh agen/tengkulak yang ada. &ldquo;Tetapi petani harus tetap menjaga kualitas buah kakao yang terbaik dengan ciri biji bulat padat dengan warna coklat,&rdquo; terangnya. Bayu mengatakan musim kemarau yang panjang bisa memacu banyaknya serangan hama penyakit sehingga produksi kakao bisa turun. Untuk mengatasi masalah tersebut, ia menambah biaya produksi dengan menjaga pengairan yang cukup dan perawatan yang ekstra seperti pemupukan dan penyemprotan hama penyakit.(Wahyuni)<span style=\"font-size: 13.5pt;\"><o:p></o:p></span></p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2018-03-16', '18:51:02', '77Teknik Budidaya Tanaman Kakao Lengkap.jpg', 4, ''),
(55, 2, 'admin', 'pelatihan Kapasitas Kelompok BUMDes', 'pelatihan-kapasitas-kelompok-bumdes', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Pekon Way Batang Kecamatan Way Batang mengadakan pelatihan Badan Usaha Milik Pekon (BUMDes) kepada masyarakat pekon setempat, yang digelar di balai pekon setempat. Menurut Kepala Pekon Way Batang Mat Hapipi menuturkan, pelatihan tersebut bertujuan untuk meningkatkan kualitas masyarakat, khususnya para pengurus BUMDes di pekon tersebut. &quot;Dengan diadakannya pelatihan ini, diharapkan masyarakat Kediri khususnya pengurus BUMDes di pekon ini bisa lebih maju lagi. Terutama dalam kemajuan dibidang pembangunan ekonomi, untuk peningkatan kesejahteraan masyrakat pekon ini,&quot; ungkapnya. Sedangkan menurut Sugianto, Kabid Pemberdayaan masyarakat pada Dinas Pemberdayaan Masyarakat Pekon (DPMP) Kabupaten Pesisir Barat menjelaskan, pelatihan ini diharapkan mampu memberikan manfaat bagi pengurus BUMDes Pekon Way Batang yang menjadi peserta dalan pelatihan ini. &quot;Dalam pelatihan ini akan diberikan tentang memahami konsep dasar kebijakan dan regulasi yang berkaitan dengan pengembangan Pekon dan BUMDes. Dan juga memahami aspek legal, peraturan berkenaan dengan BUMDes,&quot; jelasnya. Selain itu, lanjutnya, akan diberikan juga tentang pemahaman manejemen BUMDes, memahami struktur dan tata kelola BUMDes. Serta memahami tentang sistem keuangan dan akuntansi BUMDes. &quot;Para peserta juga akan mendapatkan pembelajaran mengenai gagasan, ide, teknik, metode, proses, aktivitas pengembangan BUMDes. Agar BUMDes yang dikelola, dapat lebih maju lagi untuk kemajuan ekonomi pekon dan meningkatkan keaehjateraan masyarakat Pekon Way Batang ini,&quot; pungkasnya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-18', '12:50:06', '37IMG_20180503_103125.jpg', 1, ''),
(56, 2, 'admin', 'pelatihan Kapasitas Kelompok Tani', 'pelatihan-kapasitas-kelompok-tani', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Kelompok Tani Pekon Way Batang Kecamatan Way Batang diberikan pelatihan pertanian, di balai pekon setempat, Selasa (24/4) kemarin. Tujuannya adalah agar kelompok tani dapat maju dan berkembang dalam kemandirian bertani, sehingga dapat menghasilkan nilai pertanian yang produktif dari pemanfaatan pekarangan rumah. Pj. Kepala Pekon Way Batang Mat Hapipi mengatakan pelatihan kapasitas yang diselenggarakan oleh pemerintah pekon dikhususkan bagi kelompok tani yang ada diPekon Way Batang.&quot;Kegiatan ini merupakan bentuk program pemerintah Pekon Way Batang yang menggunakan dana Pekon untuk pelaksanaan bidang pemberdayaan bagi masyarakat,&quot; pungkasnya. Dia melanjutkan, kegiatan pemberdayaan masyarakat dilaksanakan sebagai bentuk realisasi usulan masyarakat dalam tahapan musDes tahun 2017 yang kita wujudkan dalam perencanaan APBdes 2018. &quot;Tujuan kegiatan ini sebagai bentuk penambahan wawasan dan pengetahuan para anggota dan kelompok tani Pekon Way Batang ,&quot; pungkasnya. Sementara itu, ketua pelaksana kegiatan Widodo mengatakan pelaksanaan kegiatan pelatihan peningkatan kapasitas bagi kelompok wanita tani Pekon Way Batang merupakan program dari realisai dana Pekon bidang pemberdayaan tahun 2018. &quot;Kami mengucapkan terimakasih kepada para kelompok tani yang telah hadir dalam mengikuti kegiatan pelatihan kapasitas bagi kelompok tani yang dilaksanakan pada hari ini. Diharapkan kapasitas kelompok tani di Pekon Way Batang dapat meningkat,&quot; katanya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Selasa', '2019-05-22', '14:39:28', '24IMG_20180502_091901.jpg', 2, ''),
(57, 2, 'admin', 'Kunjungan 8 Negara Ke Pekon Way Batang', 'kunjungan-8-negara-ke-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Sebanyak 8 negara Asia dan Afrika melakukan kunjungan ke Pekon Way Batang, Kecamatan Way Batang. Kunjungan tersebut dalam rangka mengetahui lebih dekat sekaligus mempelajari keberhasilan program Sanitasi Total Berbasis Masyarakat (STBM) di Bumi Jejama Secancanan. Adapun kedelapan perwakilan negara tersebut, yang meliputi Kamboja, Nepal, Bhutan, Kenya, Zambia, Rwanda, Ethiopia, dan lndonesia sendiri, serta perwakilan dari SNV Netherlands, sebuah organisasi non-pemerintah dari Negeri Belanda yang concern pada pembangunan sanitasi di negara-negara berkembang. Dalam kesempatan tersebut, perwakilan SNV Global Belanda, Anteonette menyampaikan apresiasi atas penyambutan yang begitu luar biasa. Dirinya menjelaskan maksud kedatangan yaitu ingin mempelajari tentang STBM dan keberhasilan Pekon Way Batang yang dulunya banyak masyarakat yang belum memiliki jamban sehat namun sekarang sudah menjadi Pekon ODF. Perwakilan kedelapan negara tersebut berdialog langsung dengan Tim STBM Kecamatan Way Batang. Ada beberapa point yang mereka tanyakan seperti kiat - kiat untuk memberikan pemahaman kepada masyarakat terkait program STBM dan dilanjutkan dengan mengunjungi langsung rumah penduduk yang sudah memiliki jamban sehat. Kepala Pekon Way Batang, Supriyono menjelaskan bahwa pada tahun 2016 dari 1.000 KK ada yang belum memiliki jamban sehat sebanyak 306 KK.&quot;Dari angka yang begitu besar, kami kemudian memberikan pemahaman (pemicuan) dengan pemateri dari Puskesmas Bumiratu untuk memberikan pemahaman tentang pentingnya memiliki jamban sehatt,&quot; ujarnya. Kemudian terkait pembiayaan dirinya mengaku melalui Badan Usaha Milik Pekon (BUMDes) memberikan pinjaman material untuk membuat jamban sehat dengan sistem pembayaran diangsur dengan angsuran yang ringan.&quot;Program pembiayaan tersebut meringankan masyarakat, terutama kalangan menengah ke bawah, dan saat ini seluruh masyarakat kami memiliki jamban sehat,&quot; tutupnya.(wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Selasa', '2019-05-22', '14:43:08', '96IMG-20180424-WA0029.jpg', 1, ''),
(58, 5, 'admin', 'Pembuatan Kemiri di Pekon Way Batang', 'pembuatan-kemiri-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Adanya sektor usaha mikro kecil dan menengah (UMKM) mampu meningkatkan perekonomian masyarakat. Hal ini seperti yang terlihat di Pekon Way Batang Kecamatan Way Batang masyarakat setempat sebagian menggantungkan hidupnya di usaha kemiri. Saat ini tercatat ada sekitar 10 orang warga Pekon Way Batang yang bekerja sebagai buruh di usaha pemecahan kemiri milik Aminudin. Aminudin mengaku dalam sehari mampu menghasilkan 200 kg kemiri yang dipasarkan di beberapa tempat di Kabupaten Pesisir Barat. Dia menjelaskan, tekhnologi sederhana yang diterapkan oleh sebagian rumah tangga di Pekon Way Batang adalah dengan menjemur kemiri di lantai atau para-para, kemudian menyiram dengan air agar kulit kemiri lepas dari oce-nya, dan memecah cangkang kemiri. &quot;Alat pemecah cangkang kemiri dibuat dari botol bekas kosmetik pelembab kulit (hand-body) yang dirancang sedemikian rupa sehingga dapat digunakan untuk menyelipkan sebuah kemiri yang kemudian dipukulkan ke bantalan keras,&quot; pungkasnya. Proses pengeringan kemiri di Pekon Way Batang masih tergantung pada sinar matahari sehingga mereka membutuhkan waktu kurang lebih tujuh hari untuk mendapatkan hasil pengeringan sesuai keinginan, sehingga kemiri yang dipecahkan dari cangkangnya tetap utuh.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Kamis', '2019-05-24', '09:09:43', '76IMG_20180514_120240.jpg', 7, ''),
(61, 8, 'admin', 'Peternakan Kerbau Pekon Way Batang', 'peternakan-kerbau-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Peternakan kerbau di Pekon Way Batang menjadikan unggulan ekonomi masyarakat di daerah ini dengan populasi mencapai 400 ekor tersebar di 5 dusun. &quot;Kami menetapkan peternakan kerbau menjadikan produk unggulan daerah,&quot; ujar salah satu peternak kerbau, Dudi Yantoni, kemarin. Selama ini, permintaan daging kerbau di pasaran cukup tinggi sehingga pemerintah terus berupaya untuk meningkatkan populasi. Mereka para peternak di Pekon Way Batang masih menganggap ternak kerbau dijadikan usaha sampingan. Karena itu, pihaknya terus melakukan pembinaan usaha juga peningkatan jumlah populasi melalui IB itu. &quot;Kami optimistis tahun ini peternakan kerbau menjadikan produk unggulan ekonomi masyarakat selain hasil pertanian,&quot; katanya. Menurut dia, jumlah populasi kerbau sebanyak 400 ekor itu sudah masuk kategori swasembada daging di Pekon Way Batang. Bahkan, setiap hari ternak kerbau bisa memasok kebutuhan daging kerbau ke luar daerah. Pengembangan ternak kerbau di Pekon Way Batang sangat potensial juga memberikan kontribusi besar terhadap perekonomian masyarakat. &ldquo;Kami tahun ke tahun terus meningkatkan populasi kerbau karena menyumbangkan pendapatan ekonomi masyarakat,&rdquo; ujarnya. Dudi Yantoni menyebutkan, jenis peternakan kerbau yang dikembangkan warga Pekon Way Batang berjenis kerbau lumpur dan berat badannya bisa mencapai 500-600 kilogram dengan harga kisaran Rp15 juta Rp25 juta per ekor.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '09:58:35', '8maxresdefault.jpg', 1, ''),
(59, 7, 'admin', 'Hasil Panen Kencur Pekon Way Batang', 'hasil-panen-kencur-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Kelompok Wanita Tani (KWT) Mega Lestari asal Kuto dalom Kecamatan Way Batang budidaya berbagai jenis tanaman di kebun kolektif di dusun dua pekon setempat. Seperti, cabai, jahe merah, sawi, kangkung, kembang kol, terong, labu dan lainnya. Ketua KWT Mega Lestari Warnijah mengatakan, saat ini memiliki anggota sebanyak 33 orang. Selain budidaya di kebun kolektif, dia mengaku saat ini para anggota kelompok juga menanam berbagai jenis sayuran tersebut di pekarangan rumah masing - masing anggota. Warnijah menyebutkan ada banyak keuntungan yang didapat dari pemanfaatan lahan pekarangan sebagai tempat budidaya tanaman. Seperti, menanam sayur sendiri dapat mengurangi pengeluaran karena anggota tidak perlu lagi beli, melainkan mengambil langsung di pekarangan. &quot;Dengan kita menanam sendiri sayuran dirumah, maka jelas akan mengurangi biaya atau pengeluaran kita, yang biasanya kita menyediakan uang untuk membeli sayur dipasar, maka jika sudah ada sayuran sendiri dirumah maka tidak perlu lagi kita keluarkan uang,&quot; ujarnya. Selanjutnya, dia menilai dengan menanam sayur sendiri akan lebih sehat dan membuat pekarangan jadi segar dan sejuk. &quot;Manfaat menanam sayur dirumah sendiri juga akan membuat pemandangan rumah dan pekarangan kita menjadi semakin sejuk dan segar karena banyak tanaman hijau,&quot; ujarnya. Warnijah mengaku, selain budidaya tanaman pihaknya juga akan membudidaya ikan lele. &quot;Saat ini kebetulan masih musim kemarau, jadi air agak sulit. Kami rencanakan bila memasuki musim penghujan budidaya lele akan segera dimulai,&quot; pungkasnya. Terpisah, Pj Kepala Pekon Way Batang Mat Hapipi sangat mengapresiasi kegiatan yang dilakukan oleh KWT Mega Lestari. Menurutnya, ada banyak manfaat yang didapatkan dari pemanfaatan lahan pekarangan sebagai tempat menanam berbagai macam tanaman. &quot;Kami selaku aparat pekon selalu mendukung program - program yang digulirkan oleh kelompok tani maupun kelompok wanita tani (KWT). Kami harapkan KWT - KWT lain di Pekon</p>\r\n</body>\r\n</html>\r\n', 'Kamis', '2019-05-02', '10:55:39', '38IMG_20180428_080958.jpg', 1, ''),
(60, 8, 'admin', 'Peternakan Kambing Di Pekon Way Batang', 'peternakan-kambing-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Guna meningkatkan perekonomian masyarakat perPekonan sekaligus memenuhi permintaan akan ketersediaan kambing tiap tahun yang semakin meningkat, masyarakat Pekon Way Batang Kecamatan Way Batang banyak yang beternak kambing. Menurut salah seorang peternak kambing, Jarwo, saat ini diperkirakan kurang lebih ada 100 orang peternak kambing di Pekonnya. Cara beternak kambing inipun bervariasi, namun masih tetap menggunakan cara tradisional dengan memanfaatkan pakan ternak yang ada di sekitar. Menurutnya, walau sekedar sampingan, budidaya ternak kambing ini sangat menguntungkan. &quot;Tapi tidak menutup kemungkinan ternak kambing seperti ini kalau sudah berkembang kedepan tidak hanya menjadi sampingan tapi menjadi penghasilan pokok dan menjadi produk unggulan khususnya warga tepian hutan,&quot; tuturnya. Jarwo berharap kepada pemerintah daerah bisa membantu warganya, khususnya ternak kambing,sehingga kedepan bisa meningkatkan perekonomian masyarakat Pekon Way Batang. Purwoko, salah satu peternak kambing di Dusun 2 RT 05 Pekon Way Batang ini mengaku sangat diuntungkan dengan beternak kambing. Buktinya, dalam kurun waktu 3 tahun beternak dengan 2 bibit betina yang di belinya seharga Rp 1,3 juta perekor kini sudah beranak hingga 16 kambing dengan harga jual kisaran Rp. 2,5 juta &ndash; Rp. 3 juta perekornya. &quot;Memelihara kambing tidaklah sulit karena memang ketersediaan makanan untuk kambing sangat melimpah di daerah kita,&rdquo; katanya. Menurutnya, berbagai macam jenis tanaman bisa dipakai untuk memberi pakan kambing, namun perlu di perhatikan makanan kambing yang paling digemari. Berdasarkan pantauan di lapangan, peternak kambing di Pekon Way Batang banyak yang memanfaatkan rumput jenis tirisidi dan rumput lainnya yang tumbuh di tepian hutan Pekon mereka. Selain itu juga ada masyarakat yang sengaja membudidayakan rerumputan dengan memanfaatkan lahan mereka maupun lahan tepian hutan. &quot;Jenis rumput yang dibudidayakan untuk pakan kambing disini adalah rumput katrina,&quot; jelasnya. Sementara untuk memenuhi syarat kesehatan ternak, kandang kambing dibuat panggung dan beratap dengan tempat makanan dan minum. &quot;Dinding-dinding kandang juga harus memiliki ventilasi agar sirkulasi udara lebih baik,&quot; pungkasnya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '09:48:58', '14Klasifikasi-hewan-kambing.jpg', 1, ''),
(62, 8, 'admin', 'budidaya ikan gurameh', 'budidaya-ikan-gurameh', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Tingginya harga pakan ikan yang mencapai kisaran Rp 10-12 ribu perkilogram membuat petani pembudidaya ikan di Pekon Way Batang Kecamatan Way Batang mulai melirik budidaya dan gurami. Demikian diungkapkan oleh peternak ikan gurami, Santoso, beberapa hari lalu. &quot;Harga oakan ikan saat ini sudah tidak terjangkau lagi, karena itu banyak petani ikan kami mulai melirik budidaya ikan gurami,&quot; katanya. Menurutnya, budidaya ikan gurami mulai dilirik petani ikan karena berdasarkan ujicoba yang dilakukan petani di pekon lainnya pertumbuhannya sangat cepat dan memberikan keuntungan yang sangat menjanjikan. &quot;Teman kami melaporkan, ikan gurami yang dipelihara itu 10 sampai 12 bulan sudah bisa dipanen, sama seperti ikan mas dan nila, dan keuntungannya ikan Bawal yang dipelihara senang memakan hijauan sehingga tidak perlu tergantung pada pakan pabrikan yang dibeli, tapi bisa diberikan dedaunan yang banyak di sekitar areal budidaya,&quot; pungkasnya. Dengan pemberian pakan hijauan untuk ikan gurami ini, terang Santoso, banyak petani yang tadinya banyak memelihara ikan nila dan ikan mas kini mulai melirik untuk beralih komoditas, namun kendalanya untuk saat ini, bibit ikan gurami masih didatangkan dari pekon lainnya. Namun, katanya, berkat adanya budidaya ikan gurami sektor perekonomian masyarakat Pekon Way Batang menjadi lebih baik. Saat ini tercatat ada 20 kepala keluarga (KK) yang menggantungkan hidupnya dari sektor tersebut.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '10:12:39', '50budidaya-ikan-gurame-di-kolam-terpal-300x176.jpg', 1, ''),
(63, 5, 'admin', 'kerajinan Genteng Di Pekon Way Batang', 'kerajinan-genteng-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><span style=\"color: rgb(75, 79, 86); font-family: Helvetica, Arial, sans-serif; font-size: 12px; white-space: pre-wrap; background-color: rgb(241, 240, 240);\">Pesisir Barat - Selain Pekon Sidoharjo, Kecamatan Pesisir Barat selama ini masyarakat Kabupaten Pesisir Barat mengenal Pekon Way Batang Kecamatan Way Batang sebagai salah satu sentra produksi genteng di Kabupaten Berjuluk Bumi Jejama Secancanan ini. Bahkan, genteng produksi pekon setempat sudah dipasarkan sampai ke luar daerah, seperti Tangerang, Jakarta dan Yogyakarta. Salah seorang pengrajin genteng, Tugiman mengaku sudah memulai usaha sebagai pengrajin genteng sudah sejak lama, bahkan sejak puluhan tahun silam. Dalam sebulan ia mengaku mampu memproduksi 16.000 - 32.000 buah genteng per bulan. Tugiman mengaku saat ini mayoritas para pengrajin genteng di Pekon Way Batang memproduksi berbagai macam jenis genteng. Diantaranya genteng 22, genteng mantili super 22 dan kerepus.&quot;Untuk harga, genteng mantili super 22 kami jual 700 per biji, genteng mantili biasa 22 dijual 570 per biji dan kerepus 1.500 per biji ,&quot;jelasnya. Ia menjelaskan bahwa Pekon Way Batang tidak hanya dikenal sebagai sentra genteng saja, tetapi sentra bahan baku pembuatan genteng berupa tanah liat,&quot;Bahkan untuk bahan baku tanah liat Pekon Way Batang dikenal hampir seluruh wilayah Lampung. Sudah banyak para produsen genteng yang mengambil tanah liat disini, karena memang kualitas yang baik,&quot;jelasnya. Dalam produksi pembuatan genteng, lanjutnya, kendala utama adalah cuaca yang tidak menentu. Menurut dia, apabila musim hujan seperti sekarang untuk mengeringkan genteng dibutuhkan waktu lebih lama.&quot;Bila musim kemarau mampu produksi 32.000 per bulan, namun bila musim penghujan seperti sekarang hanya mampu produksi 16.000 per bulan,&quot;katanya. Dijelaskannya bahwa usaha genteng yang berada di Pekon Way Batang sudah sedari dulu ada. Menurutnya mulai ada perajin genteng dimulai sekitar tahun 1970 - 1975. Dirinya kedepan pengusaha genteng tersebut untuk tetap eksis, karena dengan adanya pengusaha genteng mampu meningkatkan perekonomian masyarakat.(Wahyuni)</span></p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-02', '10:35:46', '66p_1502706081774-produksi-pabrik-genteng-jatiwangi-majalengka.jpg', 1, ''),
(64, 7, 'admin', 'Pertanian Jagung Di Pekon Way Batang', 'pertanian-jagung-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Pertanian hortikultura menjadi potensi andalan Pekon Way Batang Kecamatan Way Batang. Dengan luas lahan pertanian holkikultura lebih dari 100 ha, Pekon Way Batang dikenal sebagai sentra pertanian holkikultura di Kabupaten Berjuluk Bumi Jejama Secancanan ini. Pj Kepala Pekon Way Batang Mat Hapipi mengatakan, potensi-potensi yang ada di pekon ini sebagaian besar di bidang pertanian, terutama padi, jagung, ubi kayu, kakao, sebagian karet dan kepala sawit. Dan produk unggulan holkikultura meliputi kedelai, cabai merah, tomat, gambas, kacang panjang dan mentimun. Mat Hapipi menceritakan pengembangan pertanian khusus hortikultura dirintis sejak tahun 1986. Pada masa itu terjadi peralihan kebiasaan petani yang sebelumnya didominasi oleh kebiasaan menanam tanaman pangan menjadi ke budidaya hortikultura. Hal ini diikuti dengan upaya penerapan inovasi dan teknologi budidaya tanaman yang lebih maju. &quot;Budidaya hortikultura dan penerapan teknologi membuat pendapatan dan kesejahteraan petani Pekon Way Batang meningkat secara signifikan. Sebagai contoh, untuk 1/4 ha lahan, petani mampu menanam 4 jenis tanaman yang meliputi tomat dengan panen minimal 10 ton, cabai merah 2,5 - 3 ton, gambas 4 ton dan kacang tanah 1 ton,&quot; ujarnya. Mat Hapipi mengatakan, hampir 80 persen penduduknya ada petani holkikultura yang mengelola lahan lebih dari 100 ha dan tidak ada lahan yang menganggur. &quot;Semua produktif untuk digunakan sebagai pengembangan budidaya hortikultura seperti cabai merah, tomat, kacang tanah dan terong,&quot; pungkasnya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '10:48:13', '40IMG_20180428_085611.jpg', 1, ''),
(65, 9, 'admin', 'Kerajinan Gerabah Bambu Di Pekon Way Batang', 'kerajinan-gerabah-bambu-di-pekon-Kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><span style=\"color: rgb(75, 79, 86); font-family: Helvetica, Arial, sans-serif; font-size: 12px; white-space: pre-wrap; background-color: rgb(241, 240, 240);\">Pesisir Barat - Sebagai salah industri rumah tangga yang mampu meningkatkan kesejahteraan masyarakat, sudah seharusnya para pengrajin anyaman bambu di Pekon Way Batang Kecamatan Way Batang mendapatkan perhatian khusus dari pemerintah. Pasalnya, saat ini pekerjaan yang menjadi tulang punggung masyarakat setempat mengalami berbagai kendala. Salah seorang pengrajin anyaman bambu asal dusun 3, Narsih mengatakan kerajinan anyaman bambu Pekon Way Batang sudah banyak dikenal warga luar pekon. Diproduksi secara turun temurun, kerajinan itu sudah berkembang dan menjadi sentra tersendiri. Menurutnya kerajinan anyaman bambu sendiri merupakan pekerjaan yang digeluti mayoritas kaum ibu. &quot;Disini hampir mayoritas ibu-ibu mencari penghasilan tambahan untuk memenuhi kebutuhan hidup sehari-hari dengan memproduksi anyaman bambu. Misalnya, di RT 12 dari total 120 kk dan berprofesi sebagai pengrajin anyaman bambu ada 105 kk,&quot;katanya. Marni menjelaskan pengolahan bambu untuk anyaman adalah dengan menebang pohon bambu, kemudian diraut dan dihaluskan baik kulit maupun isi, lalu dikeringkan dan kemudian dianyam. Bambu yang sudah diolah dapat dipergunakan untuk membuat apa yang diinginkan perajin, seperti ekrak (tempat sampah), kurungan, besek (wadah makanan), bilik, cetok (topi petani) dan masih banyak yang lainnya secara manual dan tradisional pembuatnya. &quot;Untuk saat ini para pengrajin anyaman bambu di sini mayoritas mengambil bambu dari Pesisir Barat. Dan rata-rata pengrajin membuat dua jenis kerajinan yaitu, renjeng/bakul dan sumbul (wadah nasi)&quot;, terangnya. Dan saat ini mayoritas pengrajin anyaman bambu mengalami berbagai kendala, mulai dari kesulitan bahan baku dan harga yang tidak stabil. Diakuinya untuk harga cenderung mengalami penurunan sekitar Rp. 5.000 - Rp. 40.000 per kodi.&quot;Selain mengalami penurunan harga, permintaan juga penurunan,&quot;paparnya. Kedepan, Marni dan teman-temannya berharap kepada pemerintah untuk bisa memberikan solusi atas permasalahan yang dihadapi para pengrajin anyaman bambu di pekonnya. Mengingat profesi tersebut menjadi tulang punggung masyarakat setempat selain bertani.(Wahyuni)</span></p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '10:54:30', '89anyaman-bambu5.jpg', 1, ''),
(66, 6, 'admin', 'Perkebunan Kopi Kediri', 'perkebunan-kopi-kediri', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><span style=\"color: rgb(75, 79, 86); font-family: Helvetica, Arial, sans-serif; font-size: 12px; white-space: pre-wrap; background-color: rgb(241, 240, 240);\">Pesisir Barat - Pekon Way Batang memang identik dengan kopi. Hampir seluruh masyarakatnya menyukai kopi. bahkan bila kita berkunjung ke salah satu rumah rekan atau kerabat kita yang ada di kawasan Kediri, menu utama kopi tidak lepas dari jamuan ala kadarnya, bukan teh atau air mineral. Ditemani dengan sebungkus rokok untuk menghidupkan suasana kekerabatan dan mengusir hawa kantuk dan dingin yang menyeruak menembus ke dalam kalbu. Tidak terkecuali dengan kawasan Pekon Way Batang. Salah satu Pekon penghasil kopi di daerah Pesisir Barat. Hampir di setiap rumah terdapat tanaman khas daerah tropis ini, bahkan tidak sedikit yang memiliki kebun sendiri untuk tanaman tersebut. Sebuah Potensi kawasan yang cocok untuk pertumbuhan tanaman yang biasa diseduh bahkan sampai ke luar benua. Salah seorang petani kopi Sarjono mengatakan, usaha perkebunan kopi yang dia geluti merupakan usaha turun temurun dari nenek moyangnya. Dia mengaku saat ini tercatat ada 45 kepala keluarga di Pekon Way Batang yang berprofesi sebagai petani kopi. Terkait pemasaran, Sarjono mengaku tak perlu pusing, karena menurutnya kopi adalah kebutuhan pokok seperti layaknya beras. Namun kedepan dirinya berharap ada perhatian khusus dari pemerintah terkait persoalan hama yang kerap menyerang pohon kopi.(Wahyuni)</span></p>\r\n</body>\r\n</html>\r\n', 'Jumat', '2019-05-10', '10:59:39', '970817293munirpanenkopi780x390.jpg', 4, ''),
(67, 8, 'admin', 'Peternakan Sapi Pekon Way Batang', 'peternakan-sapi-pekon-kuta-dalom', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Bisnis ternak sapi memang salah satu usaha peternakan yang memerlukan ketelitian dan kesabaran khusus dalam menjalankannya. Tidak mudah, dikarenakan ada banyak sekali hal hal yang perlu diperhatikan baik dalam kandang sendiri ataupun dampaknyaterhadap lingkungan sekitar. Usaha peternakan sapi sendiri bukanlah sebuah usaha ternak yang menjanjikan dengan modal kecil dan menguntungkan dalam waktu yang singkat. Anda memerlukan ekstra kesabaran dan modal yang cukup untuk bisa melakukan pembibitan, perawatan, pemberian pakan kepada hewan dan perawatan kandang, dan strategi bisnis ternak yang mumpuni. Salah satu cara melakukan budidaya sapi adalah dengan melakukan usaha penggemukkan sapi. Penggemukan sapi tidak hanya dilakukan dengan cara memberikan pakan saja, namun pemberian vitamin juga harus dilakukan agar sapi tetap sehat dan kebutuhan gizinya terjaga. Pembudidaya harus pandai mencari pakan yang cocok untuk sapi terutama dalam masa penggemukan sapi alami tersebut. Maryono adalah satu warga Pekon Way Batang memulai usaha penggemukkan sapi sejak akhir 2001. Maryono menggemukkan sapi dengan jenis sapi simetal di yang tak jauh dengan tempat tinggalnya. Maryono dulunya merupakan karyawan di sebuah perusahaan swasta. Krisis moneter membuatnya melirik usaha penggemukan sapi sebagai penyambung hidup keluarganya. &ldquo;Dulu saya kerja di Jakarta, namun dipecat karena krisis moneter. Saya memutuskan untuk pulang kampong dan mencoba-coba ternak sapi. Saya belajar dari peternak yang telah sukses dan membeli enam ekor sapi sebagai modal awal,&rdquo; ujarnya. Usaha penggemukan sapi milik Maryono kini semakin maju dengan bertambahnya jumlah sapi yang digemukkannya. Dia mengatakan keuntungan usaha ini sangat dipengaruhi oleh harga makan serta harga jual sapi yang sangat fluktuatif. Maryono mengatakan setidaknya dalam sebulan mampu meraup keuntungan dua juta rupiah setiap bulannya pengeluaran dan pendapatan. &ldquo;Saya berharap kedepannya usahanya lebih berkembang. Pemerintah tidak banyak impor lagi dan harganya tetap stabil,&rdquo; pungkasnya. Berdasarkan data yang dihimpun, saat ini tercatat ada 15 warga Pekon Way Batang yang beternak sapi seperti Maryono. Adanya ternak sapi diharapkan dapat meningkatkan taraf hidup masyarakat setempat.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Senin', '2019-05-11', '09:33:04', '30130404_ternak sapi.jpg', 12, '');
INSERT INTO `berita` (`id_berita`, `id_kategori`, `username`, `judul`, `judul_seo`, `headline`, `isi_berita`, `hari`, `tanggal`, `jam`, `gambar`, `dibaca`, `tag`) VALUES
(68, 7, 'admin', 'Pertanian Padi Pekon Way Batang', 'pertanian-padi-pekon-kuta-dalom', 'Y', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pesisir Barat - Untuk mendukung program pemerintah pusat dalam menyuksekan program 1.000 Pekon Mandiri Benih, Kelompok Tani Rukun Karya 4 Pekon Way Batang kembangkan berbagai jenis benih padi unggulan. Saat ini, Poktan Tani Rukun Karya 4 telah mengembangkan tiga jenis benih unggulan, seperti Ciherang, Mekongga dan Inpari 30. Diharapkan, ketersediaan benih unggul tersebut akan mendongkrak produksi padi di wilayah setempat dan terwujudnya swasembada beras. &quot;Pemerintah pusat sejak tahun 2016 lalu telah mencanangkan 1.000 Pekon Mandiri Benih. Dengan program tersebut pemerintah berharap petani tak lagi kesulitan mendapatkan benih unggul dan bermutu,&quot; ujar ketua Poktan Tani Rukun Karya 4, Edi Suryadi. Edi Suryadi mengungkapkan masing-masing produk benih padi miliknya mempunyai kelebihan dan kekurangan masing-masing. Seperti benih Ciherang memiliki keunggulan tahan hama, umur pendek (hanya pembeninhan 85 hari) nasi lebih pulen dan tahan basi. Kemudian, untuk benih Mekongga memiliki cabang lebih banyak, nasi lebih enak, namun ulir padi lebih pendek dan tidak penanaman harus di rawa - rawa. Selanjutnya benih Inpari 30, dalam 1 ha mampu menghasilkan 11 ton, namun waktu ditanam harus cukup air (lahan basah) dan pupuk harus cukup. Pj Kepala Pekon Way Batang Mat Hapipi mengatakan program tersebut merupakan program Kementerian Pertanian mengupayakan agar kebutuhan benih petani dapat dipenuhi dari produksi petani sendiri sehingga petani mandiri dalam kebutuhan benih yang dibutuhkannya. &quot;Kebijakan ini sebagai tindak lanjut dari program Presiden RI Joko Widodo yakni mewujudkan kemandirian pangan. Untuk menyelesaikan salah satu permasalahan utama pertanian, yakni kurangnya ketersediaan dan rendahnya kualitas benih padi yang menyebabkan produksi padi petani stagnan bahkan menurun,&quot; jelasnya. Menurutnya, Pembentukan Pekon mandiri benih ini diharapkan kebutuhan benih petani dapat dipenuhi dari produksi petani sendiri, sehingga petani mandiri dalam memenuhi kebutuhan benih yang dibutuhkan. &quot;Untuk Provinsi Lampung ada 12 pekon (Pekon) dan poktan kami salah satunya yang dipercaya oleh pemerintah. Pengembangan Pekon Mandiri Benih juga men&shy;jadi sebuah asa bagi petani untuk men&shy;dapatkan benih unggul dan tepat waktu,&quot; pungkasnya.(Wahyuni)</p>\r\n</body>\r\n</html>\r\n', 'Senin', '2019-05-11', '09:33:55', '24jejamo.jpg', 9, '');
