(28, 'Sarana dan Prasarana Pekon Way Batang', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Sarana dan Prasarana yang dimiliki Pekon Way Batang adalah sebagai berikut :&nbsp;</p>\r\n\r\n<table class=\"table table-bordered table-striped\">	<tbody>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">No.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p align=\"center\">Sarana dan Prasarana</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">Jumlah</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">1.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Kantor Pekon</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">1 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">2.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Puskesmas pembantu</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">1 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">3.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Paud</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">2 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">4.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>SD Negeri</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">2 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">5.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Minimarket</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">1 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">6.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Masjid</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">3 unit</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:47px;\">\r\n			<p align=\"center\">7.</p>\r\n			</td>\r\n			<td style=\"width:180px;\">\r\n			<p>Mushola</p>\r\n			</td>\r\n			<td style=\"width:227px;\">\r\n			<p align=\"center\">5 unit</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</body>\r\n</html>\r\n', '2018-07-30', ''),
(23, 'Profil Pekon Way Batang', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><strong>1. Visi </strong></p>\r\n\r\n<h3 style=\"color:#aaa;font-style:italic;\">Menjadikan masyarakat Pekon Way Batang yang aman, damai dan sejahtera dengan berdasarkan keimanan dan ketaqwaan terhadap Tuhan Yang Maha Esa</h3>\r\n\r\n<p><strong>2. Misi&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>\r\n	<h3 style=\"color:#aaa;font-style:italic;\">Peningkatan pelayanan yang lebih baik kepada masyarakat</h3>\r\n	</li>\r\n	<li>\r\n	<h3 style=\"color:#aaa;font-style:italic;\">Bersama masyarakat dan kelembagaan pekon menyelenggarakan pemerintahan dan melaksanakan pembagunan yang partisipatif</h3>\r\n	</li>\r\n	<li>\r\n	<h3 style=\"color:#aaa;font-style:italic;\">Bersama masyarakat ddan kelembagaan pekon dalam mewujudkan Pekon Way Batang yang berkualitas, tentram dan damai</h3>\r\n	</li>\r\n	<li>\r\n	<h3 style=\"color:#aaa;font-style:italic;\">Optimalisasi peran kelembagaan yang ada di pekon .</h3>\r\n	</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '2018-03-14', ''),
(25, 'Gambaran Umum Pekon Way Batang', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<div>Monografi</div>\r\n\r\n<div>1.Orbitasi&nbsp;</div>\r\n\r\n<div>a.Jarak ke Ibu Kota Kecamatan Way Batang<span style=\"white-space:pre\"> </span>: 1<span style=\"white-space:pre\"> </span>km</div>\r\n\r\n<div>b.Jarak ke Ibu Kota Kabupaten Pesisir Barat : 11<span style=\"white-space:pre\"> </span>km</div>\r\n\r\n<div>c.Jarak ke Ibu Kota Provinsi&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : 70<span style=\"white-space:pre\"> </span>km</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>2.Batasan-batasan wilayah Pekon Way Batang</div>\r\n\r\n<div>Letak geografis Pekon Way Batang terletak diantara:&nbsp;</div>\r\n\r\n<div>a.Sebelah Utara berbatasan dengan Pekon Way Batang</div>\r\n\r\n<div>b.Sebelah Selatan berbatasan dengan Pekon banjar manis</div>\r\n\r\n<div>c.Sebelah Barat berbatasan dengan Pekon sukaraja</div>\r\n\r\n<div>d.Sebelah Timur berbatasan dengan Pekon purwodadi.</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>3.Jumlah penduduk berdasarkan jenis kelamin</div>\r\n\r\n<div>a.Kepala Keluarga : &plusmn;846 KK`<span style=\"white-space:pre\"> </span></div>\r\n\r\n<div>b.Laki-laki <span style=\"white-space:pre\"> </span>: &plusmn;1781 Jiwa</div>\r\n\r\n<div>c.Perempuan <span style=\"white-space:pre\"> </span>: &plusmn;1746 Jiwa</div>\r\n\r\n<div>d.Total <span style=\"white-space:pre\"> </span>: &plusmn;4373 Jiwa</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Topografi</div>\r\n\r\n<div>Pekon Way Batang adalah Pekon yang berada di kecamatan Way Batang, Kabupaten Pesisir Barat, Provinsi Lampung yang memiliki luas wilayah &plusmn;190 Hektar dan memiliki 4 (empat) dusun, yaitu :</div>\r\n\r\n<div>1.Way Batang<span style=\"white-space:pre\"> </span>: &plusmn;285 Jiwa</div>\r\n\r\n<div>2.Muara Agung<span style=\"white-space:pre\"> </span>: &plusmn;150 Jiwa</div>\r\n\r\n<div>3.Tegal Sari<span style=\"white-space:pre\"> </span>: &plusmn;323 Jiwa</div>\r\n\r\n<div>4.Kedatuan<span style=\"white-space:pre\"> </span>: &plusmn;88 <span style=\"white-space:pre\"> </span>Jiwa</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>Kependudukan&nbsp;</div>\r\n\r\n<div>1.Jumlah penduduk Pekon Way Batang berdasarkan Profil Pekon Tahun 2017 adalah &plusmn;846 KK atau &plusmn;4373 jiwa yang terdiri dari, Laki-laki &plusmn;1781 jiwa dan Perempuan : &plusmn;1746 jiwa.</div>\r\n\r\n<div>2.Data penduduk menurut agama&nbsp;</div>\r\n\r\n<div>a.Islam <span style=\"white-space:pre\"> </span>: &plusmn;3451<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>b.Katolik <span style=\"white-space:pre\"> </span>: &plusmn;21<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>c.Kristen<span style=\"white-space:pre\"> </span>: &plusmn;16<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>d.Hindu <span style=\"white-space:pre\"> </span>: &plusmn;0 <span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>e.Budha <span style=\"white-space:pre\"> </span>: &plusmn;0<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>3.Data penduduk menurut status pendidikan</div>\r\n\r\n<div>a.Tidak tamat SD <span style=\"white-space:pre\"> </span>: &plusmn;5 <span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>b.Tamat SD <span style=\"white-space:pre\"> </span>:&plusmn;89 <span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>c.Tamat SLTP <span style=\"white-space:pre\"> </span>:&plusmn;46 <span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>d.Tamat SLTA<span style=\"white-space:pre\"> </span>:&plusmn;73<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>e.Tamat AK/PT<span style=\"white-space:pre\"> </span>: &plusmn;166<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div>4.Data penduduk menurut mata pencaharian</div>\r\n\r\n<div>a.Petani <span style=\"white-space:pre\"> </span>:&plusmn;582<span style=\"white-space:pre\"> </span>Orang</div>\r\n\r\n<div>b.