(27, 'Sambutan Kepala Pekon Way Batang', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p><span style=\"font-size: 13.5pt;\">Puji syukur rahmad dan karunia Allah SWT sehingga saya mampu menuliskan kata sambutan kepala pekon dalam rangka penerbitan website Pekon Way Batang sebagai sarana informasi dan komunikasi up date pekon ini melalui dunia maya. Untuk itu saya mengucapkan banyak terima kasih kepada semua pihak yang mendukung terbitnya website ini, terutama kepada TIM ICT Pekon Way Batang yang selalu berusaha meningkatkan layanan ICT-nya.<o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size: 13.5pt;\">Di era global dan pesatnya Teknologi Informasi ini, tidak dipungkiri bahwa keberadaan sebuah website untuk suatu &nbsp;instansi seperti halnya di Pekon Way Batang sangatlah penting. Wahana website tersebut dapat digunakan sebagai sarana informasi dan komunikasi pihak Pekon dengan masyarakat, alumni, dan stake holder secara luas. Selanjutnya, website Pekon dapat berfungsi sebagai media pembelajaran yang yang dibuat oleh sri wahyuni.<o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size: 13.5pt;\">Di dalam website tersebut admin dapat menuliskan berbagai artikel tentang informasi pekon atau kegiatan yang berkaitan dengan Pekon Way Batang. Selain itu juga website juga dapat menjadi sarana promosi Pekon yang cukup efektif. Berdasarkan hal tersebut saya harapkan nantinya berbagai kegiatan positip Pekon (intrakurikuler &amp; ekstrakurikuler) dapat diunggah diwebsite Pekon Way Batang ini, sehingga masyarakat dapat mengetahui informasi dan kegiatan-kegiatan dan yang telah lakukan oleh Pekon ini.<o:p></o:p></span></p>\r\n\r\n<p><span style=\"font-size: 13.5pt;\">Akhirnya kami mengharapkan masukan dari berbagai pihak untuk website ini agar kami terus belajar dan meng-up date diri, sehingga tampilan, isi dan mutu website akan terus berkembang dan lebih baik nantinya. Oleh karena itu, saya memberikan dukungan sepenuhnya kepada TIM ICT Pekon Way Batang selaku pengelola website Pekon agar terus mengembangkan website dengan penuh semangat tanpa mengenal menyerah. Terima kasih atas kerjasamanya, maju terus untuk mencapai Pekon Way Batang yang lebih Makmur dan menjadi pemerintahan yang transparan.&nbsp;<o:p></o:p></span></p>\r\n</body>\r\n</html>\r\n', '2019-05-27', 'IMG-20180427-WA0006.jpg'),
(11, 'Visi dan Misi', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Sebagai dokumen perencanaan yang menjabarkan dari Dokumen RPJM Pekon, maka seluruh rencana program dan kegiatan pembangunan yang akan dilakukan oleh Pekon secara bertahap dan berkesinambungan harus dapat menghantarkan tercapainya Visi &ndash; Misi Pekon.Adapun Visi dan Misi Pekon Kutadalom sebagai berikut :<br />\r\n<strong>Visi</strong><br />\r\nMenjadikan Pekon Way Batang Bersih, Indah,Nyaman Religius, Sejahtera, dan Mandiri.<br />\r\n<strong>Misi&nbsp;</strong><br />\r\na.Mengadakan Gotong-royong setiap bulannya dalam rangka bersih Pekon dan pelaksanaan Siskamling.<br />\r\nb.Mengembangkan sarana dan prasarana pemerintahan pekon sebagai upaya peningkatan kinerja aparat pemerintah pekon.<br />\r\nc.Mengembangkan pembangunan infrastruktur yang baik dan mandiri serta untuk mendukung produktifitas sektor pertanian dan perkebunan.<br />\r\nd.Pengelolaan sampah secara berencana dan terpadu.<br />\r\ne.Meningkatkan pelayanan kepada masyarakat di semua bidang.<br />\r\nf.Meningkatkan mutu dan kualitas pendidikan agama melaui Pendidikan Alquran.<br />\r\ng.Meningkatkan mutu dan kualitas SDM aparatur pemerintah pekon, Guru ngaji, anggota lembaga pekon, pengurus PKK pekon, Guru PAUD dan Guru TK.<br />\r\nh.Mengurangi angka pengangguran (mengadakan pelatihan).<br />\r\ni.Meningkatan ekonomi masyarakat kecil/miskin dengan mengusahakan pinjaman modal.<br />\r\nj.Meningkatkan kesejahteraan dan taraf hidup bagi&nbsp; aparatur pemerintah pekon, Pengurus dan anggota lembaga pekon serta linmas, Guru ngaji,&nbsp; Anggota lembaga pekon, pengurus PKK pekon, Guru PAUD dan Guru TK.<br />\r\nk.Mengusahakan dan memfasilitasi penjualan hasil bumi warga masyarakat keluar daerah dan memberikan bantuan di saat musim paceklik dengan bantuan sembako (pangan)<br />\r\nl.Mengadakan penyuluhan, pemberian pinjaman modal, pemberian subsidi pupuk dan bibit bagi petani maupun memberikan Bantuan kepada petani disaat musim paceklik.<br />\r\nm.Memberikan santunan dan bantuan buat Fakir miskin, anak yatim, siswa miskin, orang jompo, orang gila dll.</p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', '2018-02-19', ''),
(12, 'Sejarah Pekon Way Batang', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Pekon Way Batang adalah hasil pemekaran dari pekon Banjar Manis Kecamatan Way Batang Kabupaten Pesisir Barat. Pekon Way Batang pada mulanya bersal dari tanah perladangan kebun,belukar dan tanah rintisan dari warga Pekon Banjarmanis. Tanah-tanah tersebut sebagian kecil sudah menjadi tanah perdagangan dan kebun kopi atau lada,sedangkan sebagian besar masih berupa belukar dan hutan lebat,yang telah menjadi tanah rintisan dari penduduk Pekon Banjarmanis . Karena merekalah yang pertama sekali datang menemukan areal tanah tersebut untuk dijadikan tempat pemukiman tempat tinggal dan perkebunan di wilayah ini.Tanah-tanah tersebut secara keseluruhan dibeli(diborong) oleh tua-tua adat Pekon Way Batang yang secara sengaja datang dari daerah asalnya yaitu Cukuh Balak(Putih Tanjung Betuah) berniat ingin mencari tempat tinggal yang baru(membuat kamping) dipinggir jalan raya yang akan dilewati Kawat Telepon (Khanglaya Kawak).&nbsp;<br />\r\nWaktu terjadinya transaksi jual beli tanah-tanah tersebut lebih kurang pada tahun 1920-an oleh tetuah kampug Kuto Dalom ,ini juga berkat bantuan dari tua-tua kampung Kedaloman selaku penghubung (penunjuk jalan mencarikan lokasi). Tua-tuakampung Way Batang yang akan berpindah terdiri dari 6 (enam) kelompok keluarga besar yaitu :<br />\r\n1.Kelompok keluarga Saibatin diwakili oleh Bapak Hasyim.<br />\r\n2.Kelompok keluarga Minak Ya diwakili oleh Bapak Hi. Gozali, Bapak Hamim dan Bapak Ibrahim (Muda Mas)<br />\r\n3.Kelompok keluarga Hi. Abdul Karim diwakili oleh Bapak Hi. Abdul Karim.<br />\r\n4.Kelompok keluarga Cinta Batin diwakili oleh Bapak Abbas.<br />\r\n5.Kelompok keluarga Abdullah diwakili oleh Bapak Abdullah dan Bapak Komajaya.<br />\r\n6.Kelompok Keluarga Minak Bangsa Niti diwakili oleh Bapak Batimin, Bapak Akup dan Bapak Abdul Kholik.</p>\r\n\r\n<p>Pada periode tahun 1925 di adakan musyawarah antara tokoh adat dari Bandakh Kedaloman dengan perwakilan dari ke-enam Kelompok keluarga tersebut untuk pemberian nama Kampung dan pengangkatan Pemangku Adat. Karena lokasi daerah ini berada di ujung wilayah Marga Gunung Alip dan sebagai ungkapan rasa terima kasih kepada penyimbang adat pekon Kedaloman yang telah membantu proses perpindahan ke-enam Kelompok tersebut dari Cukuh Balak maka wilayah ini diberi nama Way Batang. Kuta berarti pagar , Dalom berarti Kedaloman atau Pekon yang memagari Dalom Kedaloman dengan wilayah Belanda (Erpah kecil /Way Batang saat ini ). Sebagai Kepala Adat Way Batang , maka oleh Kepala Bandakh Kedaloman yaitu Dalom Ya Sangun Ratu dilantiklah Khaja Pagar alam menjadi Kepala adat di Way Batang , sedangkan dalam pemerintahan Negara , Way Batang masuk kedalam wilayah Pekon Banjarmanis sebagai salah satu pedukuhan di Pekon tersebut dan sebagai Kepala suku/Pedukuhan Way Batang adalah Bapak Abdul Razak bin Hasyim.</p>\r\n\r\n<p><br />\r\nPada priode tahun 1973 pendukuhan Way Batang resmi memisahkan diri dari pekon Banjar Manis dan Pekon Way Batang membentuk 4 pedukuhan/dusun untuk membantu jalannya roda pemerintahan yaitu :<br />\r\n1.Dusun Way Batang<br />\r\n2.Dusun Muara Agung<br />\r\n3.Dusun Tegal Sari<br />\r\n4.Dusun Kedatuan</p>\r\n\r\n<p>Sejak periode awal mula terbentuknya Pekon Way Batang Tahun 1973 sampai sekarang, Way Batang telah mengalami 4 kali pergantian kepemimpinan yaitu :<br />\r\n1.Bapak Sirajuddin Yahya , keturunan dari bapak Hasyim . beliau adalah perintis pertama berdirinya Pekon Way Batang. memimpin sejak awal mula Pekon Kutadalom berdiri tahun 1973 sampai dengan Tahun 1989.<br />\r\n2.Bapak syarifuddin Amin , keturunan dari Bapak Abdullah . beliau memimpin pekon kutadalom dari Tahun 1989 sampai dengan Tahun 2006.<br />\r\n3.Bapak Nurul Fihri , keturunan dari bapak abdullah.Beliau memimpin pekon Kutadalom sejak Tahun 2006 sampai dengan Tahun 2012.<br />\r\n4.Bapak Nurul Fihri , keturunan dari bapak abdullah.Beliau memimpin pekon Kutadalom sejak Tahun 2012 sampai dengan Tahun 2019.</p>\r\n</body>\r\n</html>\r\n', '2018-02-19', '');
